import React, { useState } from "react";
import styles from "./Button.module.css";

const Button = (props) => {
  console.log(props.active);

  return (
    <button
      type={props.type}
      className={styles.btn}
      onClick={props.onClick}
      style={{
        border: "1px solid #fff",
      }}
    >
      {props.children}
    </button>
  );
};

export default Button;
